import React from 'react';

const Profile = () => {
  return (
    <div className="profile">
      <img src="https://via.placeholder.com/150" alt="Profile" />
      <h2>Nerox - Sky</h2>
      <p>Nerox Eternal, Majestic Resolve</p>
    </div>
  );
};

export default Profile;
